function opsta(){
    let username=getCookie("username");
    let check = false;
    let tmp = -1;
    for(let i in phone){
        if(username == phone[i]){
            check = true;
            tmp = i;
        }
    }
    if(check == true){
      document.getElementById("company").innerHTML = company[tmp];
    }else{
      window.location = "index.html";
    }
}
function getCookie(cname){
  var name = cname + "=";
  var ca = document.cookie.split(';');
  for(var i=0; i<ca.length; i++) 
  {
    var c = ca[i].trim();
    if (c.indexOf(name)==0) return c.substring(name.length,c.length);
  }
  return "";
}
